import React from "react";

export default function StateViewer({ state }) {
  let stateArray = JSON.stringify(state).split(",");
  let lines = stateArray.map((line) => {
    return <div>{line}</div>;
  });
  return (
    <div
      style={{
        padding: "50px",
        color: "rgb(200,200,200)",
        fontSize: 18,
        letterSpacing: "1.5px",
        lineHeight: "25px",
        fontWeight: 400,
      }}
    >
      {lines}
    </div>
  );
}
